import React from 'react';
import Header from './Header'
import '../App.css';
import Generate from './Generate';

function App() {

  const save = () =>{
    fetch("https://andruxnet-random-famous-quotes.p.rapidapi.com/?cat=famous&count=10", {
	"method": "GET",
	"headers": {
		"x-rapidapi-host": "andruxnet-random-famous-quotes.p.rapidapi.com",
		"x-rapidapi-key": "8f5cc82a7emsheb4229491b6bb7bp1abfc8jsn1c33030bb103"
	}
})
.then(response => {
	console.log(response);
})
.catch(err => {
	console.log(err);
});
  }

  return (
    <div className="App w3-container" id="quote-box" >
      <Header title="Random Quote Generator"/>
      <Generate save={save}/>

    </div>
  );
}

export default App;
